//C:\react-js\my-app\src\components\Dashboard.js
import React, { useEffect, useState } from "react";
import { Link, useNavigate } from 'react-router-dom';
import '../App.css';
import axios from "axios";
 
export default function Dashboard() {
    const navigate = useNavigate();
    function logoutSubmit(){
        localStorage.setItem("login", "");
        localStorage.setItem("loginStatus", "Logged out successfully!")
        navigate("/");
    }

    const [courses, setCourses] = useState([]);
    const [error, setError] = useState(null);

    const handleView = (item) => {
        var params = {
          course_id: item.id
        };
        axios.put('http://localhost:80/student-courses-api/courses',params)
        .then((response) => {
        }).catch((err) => {
            setError(err);
            console.log(err);
        })
    }

    const handleFilterChange = () => {

    }

    const handleEdit = (item) => {
      var params = {
        course_id: item.id
      };
      axios.put('http://localhost:80/student-courses-api/',params)
      .then((response) => {
      }).catch((err) => {
          setError(err);
          console.log(err);
      })
    }

    const handleDelete = (item) => {
      axios.delete(`http://localhost:80/student-courses-api/${item.id}`)
      .then((response) => {
        if(response.data.status == 1){
          getCoursesData();
        }else{
          setError('Error deleting record');
        }
      }).catch((err) => {
          setError(err);
          console.log(err);
      })
    }

    const getCoursesData = () => {
      try {
        axios.get('http://localhost:80/student-courses-api/')
        .then((response) => {
          setCourses(response.data); 
          return response.data;
        })
      } catch (error) {
        setError(error);
      } 
    };

    useEffect(() => {
      getCoursesData();
    }, [])
    
    return(
        <div className="main-container">
          <nav className="navbar navbar-expand-md navbar-light">
              <div className="container">
                <a className="navbar-brand" href="/">Welcome to High Tech Online Courses Platform</a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                  <span className="navbar-toggler-icon" />
                </button>
              </div>
              <label>Status</label>
                <select className="" id="dropdown">
                    <option value="">Filter Results</option>
                    <option onchanhe>Active</option>
                    <option>Inactive </option>
                </select>
          </nav>
          <section>
            <table className='table table-hover table-responsive table-bordered'>
              <thead>
                <tr>
                  <th>Course Name</th>
                  <th>Course Description</th>
                  <th>Start Date</th>
                  <th>End Date</th>
                  <th>Status</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
              {courses.map((item, key) => (
                    <tr key={key}>
                      <td>{item.course_name}</td>
                      <td>{item.description}</td>  
                      <td>{item.start_date}</td>
                      <td>{item.end_date}</td>
                      <td>{item.status == 1 ? 'Active' : 'Inactive'}</td>
                      <td>
                        <button className="btn btn-primary m-2" onClick={() => handleView(item)}><span className='glyphicon glyphicon-list'></span> Read</button>
                        <Link to={`/edit-course/${item.id}`}><button className="btn btn-info m-2" onClick={() => handleEdit(item)}><span className='glyphicon glyphicon-edit'></span> Edit</button></Link> 
                        {
                          item.status == 1 ? (<button className="btn btn-danger delete-object m-2" onClick={() => handleDelete(item)}><span className='glyphicon glyphicon-remove'></span> Delete</button>)
                          : (<button className="btn btn-danger delete-object m-2" onClick={() => handleDelete(item)} disabled><span className='glyphicon glyphicon-remove' disabled></span> Delete</button>)
                        }
                        
                      </td>
                    </tr>
                ))}
              </tbody>
          </table>
          </section>  
        </div>
    )
}
